import styled from "styled-components";

export const Title = styled.text`
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    position: absolute;
    left: 150px;
    top: 16px;
`;

export const Container = styled.div`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
    top: 18px;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
    top: 18px;
`;

export const Container1 = styled.div`
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 102px;
    background: #F7F8F8;
    border-radius: 16px;
`;

export const Text1 = styled.text`
    position: absolute;
    width: 51px;
    height: 18px;
    left: 75px;
    top: 118px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;

export const Container2 = styled.div`
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 162px;
