    position: absolute;
    width: 85px;
    height: 18px;
    left: 75px;
    top: 178px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;

export const Container3 = styled.div`       
    position: absolute;
    width: 315px;
