    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;
export const Container4 = styled.div`       
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 282px;
    background: #F7F8F8;
    border-radius: 16px;
`;

export const Text4 = styled.div`
    position: absolute;
    width: 161px;
    height: 18px;
    left: 75px;
    top: 298px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;

export const Title1 = styled.text`
    position: static;
    width: 34px;
    height: 24px;
    left: 171.5px;
    top: 730px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 24px;
    color: #FFFFFF;
    flex: none;
    order: 0;
    flex-grow: 0;
    margin: 0px 10px;
    justify-content: center;
`;

export const Button1 = styled.button`
    justify-content: space-between;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius:99px;
    position: absolute;
    top:585px;
    width: 315px;
    height: 60px;
    left:31px;
    display: flex;
    flex-direction: row;
    align-items: flex-start;
    padding: 18px 129px;
    box-shadow: 0px 10px 22px rgba(149, 173, 254, 0.3);
    border: none;
`;

