    position: absolute;
    width: 14px;
    height: 14px;
    left: 286px;
    top: 19.5px;
    background: #FFFFFF;
    border-radius: 20px;
`;

export const Text5 = styled.text`
    position: absolute;
    width: 45px;
    height: 15px;
    left: 260px;
    top: 120px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 10px;
    line-height: 15px;
    text-align: right;
    color: #ADA4A5;
`;

