    position: absolute;
    width: 90px;
    height: 15px;
    left: 215px;
    top: 180px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 10px;
    line-height: 15px;
    text-align: right;
    color: #ADA4A5;
`;

