    position: absolute;
    width: 49px;
    height: 15px;
    left: 256px;
    top: 240px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 10px;
    line-height: 15px;
    text-align: right;
    color: #ADA4A5;
`;
